import React from 'react';
import Tile from './Tile';

class Grid extends React.Component {
	constructor(props) {
		super(props);
		Grid.instance = this;

		this.cells = [
			{ x: 0, y: 0},
			{ x: 1, y: 0},
			{ x: 2, y: 0},
			{ x: 3, y: 0},

			{ x: 0, y: 1},
			{ x: 1, y: 1},
			{ x: 2, y: 1},
			{ x: 3, y: 1},

			{ x: 0, y: 2},
			{ x: 1, y: 2},
			{ x: 2, y: 2},
			{ x: 3, y: 2},

			{ x: 0, y: 3},
			{ x: 1, y: 3},
			{ x: 2, y: 3},
			{ x: 3, y: 3}
		];
	}

	render() {
		const tiles = [];
		for (let cell of cells) {
			tiles.push(<Tile destination={cell} />);
		}
		return(
			<div className="grid">
				<Tile destination={{ x: 0, y: 0}} />
			</div>
			);
	}
}

export default Grid;
